import React, { Component } from 'react';
import CardList from './CardList';
import { kanjiList } from './kanji';
import SearchBox from './SearchBox';





class App extends Component {
  constructor() {
    super();
    this.state = {
      kanjiList: kanjiList,
      searchField: ''
    }
  }
  render() {
    return(
      <div className='tc '>
        <h1>Hello Welcome to Michael's 糞っぽい Kanji Dictionary</h1>
        <SearchBox />
        <CardList kanji={kanjiList}/>
      </div>
    );
  }


}

export default App;
